import React from 'react';


const Cartlist1 = (props) => {

   
 return(
        <div >
          <p>{props.couponcode}</p> 
          <p>{props.price}</p>
          <p>{props.off}</p>

          <Table >
                 <tbody>
                     <tr>
                     <td><b>{props.id}</b></td>
                     <td style={{width:'22.5%', padding:'8%', color:'green'}}><b>{props.cat}</b></td>
                     <td style={{width:'22.5%', padding:'8%'}}><b>Rs.{props.price*props.cat}</b></td>
                     </tr>
                 </tbody>
           </Table>
        </div>
       
 )                               
           
    
}

export default Cartlist1;
